                    <div class=""con-text"">
                        <p class=""text-p"">北京中企网动力数码科技有限公司创建于1999年，是中国数码信息有限公司（股票代码：0250.HK）的全资子公司，在全国设有80家分公司，拥有员工8000余人。</p>
                        <p class=""text-p"">中企动力云基于PaaS+SaaS服务模式，将门户云、业务云、营销云、管理云、设计云整合为一站式互联网智能运营服务和行业解决方案，满足企业个性化、多样化的互联网转型需求。随时、随需提供智能经营与管理服务，帮助企业全面提升经营效率，实现企业数字化智能运营，打造智慧企业，持续为客户创造商业价值。</p>
